import React from 'react';
import photo from '../assets/autograph.jpg';
import github from '../assets/download.png';

const Sidebar = () => {
    return (
        <div className="sidebar">
            <img src={photo} alt="photo" className="sidebarPhoto" />
            <div className="sidebarName">Steven <span>Schaab</span></div>
            <div className="sidebarItem sidebarTitle">Web Developer</div>
            <a href="">
                <div className="sidebarItem">
                    <img src="" alt="" className="sidebarIcon" />Download Resume
                </div>
            </a>
            <div className="contact">
                <div className="sidebarItem">
                    <a href=""><img src={github} alt="github" className="sidebarIcon"/></a>
                </div>
                <div className="sidebarItem">schaab.steven@gmail.com</div>
                <div className="sidebarItem">773.656.9747</div>
            </div>
            <div className="sidebarItem sidebarEmail"></div>
        </div>
    )
}

export default Sidebar;
